            <div className="authentication-details">
              <h6><b>Notifications</b></h6>
            </div>
          </div>
        </div>
        <table className="table">
          <tr>
            <th>Students No</th>
            <th>Admission Class</th>
            <th>Vehicle Id</th>
            <th>Student Name</th>
            <th>Mobile</th>
            <th>Email</th>
            <th>Admission Date</th>
          </tr>
          <tr>
            <td>24</td>
            <td>3rd</td>
            <td>1</td>
            <td>vysh3</td>
            <td>+917012962320</td>
            <td>sinu.jamal@zaeemsolutions.com</td>
            <td>12-02-2022</td>
          </tr>
        </table>
      </div>
    </div>
  );
};

export default ParentDetails;
